// $_SESSION['s3']['IdentityPoolId'] = "us-west-2:78aae9fb-21b1-428e-8b4e-86e5b21de9b2";

import { Upload } from "@aws-sdk/lib-storage";
import { S3Client, S3 } from "@aws-sdk/client-s3";

export const upload = async (file) => {
  const target = { Bucket: "mogulvideo", Key: "mogul-in-react", Body: file };
  const IdentityPoolId = "us-west-2:3c1efe0a-3ff9-4b0d-a1a6-4f5e701237fa";

  try {
    const parallelUploads3 = new Upload({
      client: new S3Client({
        region: "us-west-2",
        credentials: { IdentityPoolId },
      }),
      params: target,
      leavePartsOnError: false,
    });

    parallelUploads3.on("httpUploadProgress", (progress) => {
      console.log(progress);
    });

    parallelUploads3.done();
  } catch (e) {
    console.log(e);
  }
};
